import React from "react";

function Carousel({ data }) {
  console.log(data);
  return (
    <div>
      {data.map((item, idx) => {
        return <img src={item.img} alt={item.alt} key={idx}></img>;
      })}
    </div>
  );
}

export default Carousel;
